    //   return { label: state.i.sn, abbr: state.i.s, key: index };
    // });
    // if (states && !_.isEmpty(states)) {
      setStates(poolsdata);
    // }
    // console.log("states data", states);
  }, []);

  const { ...rest } = props;
  return (
    <div>
      <Header
        color="transparent"
        routes={dashboardRoutes}
        // rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 90,
          color: "grey",
        }}
        {...rest}
      />
      <Parallax filter image={require("assets/img/US-Map.jpg")}>
        <div className={classes.container}>
        {states1 && states1.data && states1.data.s && 
          states1.data.s .map((y, index) => (
            <Button 
            onClick={StatesRoute}

            style={{ background: "#22223b", align: "center" }}>
              {y.i.sn}, {y.i.s}
            </Button>
          ))}
        </div>
      </Parallax>
      <Card style={{width:'250px',display:'contents'}}>

      </Card>
      <Footer />
    </div>
  );
}
